import Header from './components/Header'
import Forecast from './components/Forecast/Forecast'
import WeatherCard from './components/Forecast/WeatherCard'
import {Container} from 'react-bootstrap'
import CitySelector from './components/Forecast/CitySelector'
import UseFetch from './components/Forecast/UseFetch'
import WeatherList from './components/Forecast/WeatherList'

const App = () => {

  const {data, error, isLoading, setUrl} = UseFetch();

  return (
    <div className="container">

      <WeatherCard 
        dt={1602104400 * 1000}
        temp_min="22.67"
        temp_max="24.39"
        main="Clear"
        icon="01d"
      />

      <Container className="App">
        <CitySelector onSearch={(city) => setUrl(`https://community-open-weather-map.p.rapidapi.com/forecast?q=${city}&units=metric`)} />

        {data && <WeatherList fivedayforecast={data.list} /> }
      </Container>

    </div>
  )
}

export default App;
